import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { UserAPIList } from '../user/user.interfaces';
import { ExercisesAPIList, UserExercisesAPIList } from './exercises.interfaces';

const EXERCISE_API = 'https://localhsost:3000/api/exercise'
const USEREXERCISE_API = 'https://localhsost:3000/api/userexercise'

@Injectable()
export class ExercisesService {

  constructor(private http: HttpClient) { }

  findAllExercises() {
    return this.http.get<ExercisesAPIList>(`${EXERCISE_API}/findall`)
  }

  findAllUserExercises() {
    return this.http.get<UserExercisesAPIList>(`${USEREXERCISE_API}/findall`)
  }
}
